import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <navigator>
          <ul>
            <li>Home</li>
            <li>Account</li>
            <li>Settings</li>
            <li>About</li>
          </ul>
        </navigator>
      </header>
    </div>
  );
}

export default App;
